  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of land derived
  from high resolution imagery and was analyzed according to the Coastal Change Analysis
  Program (C-CAP) protocol to determine land cover. This data set utilized 10 full
  or partial WorldView2 multispectral scenes and the 2005 high-resolution Guam C-CAP
  data set. The imagery and base classification were included in a multi-step semi-automated
  change detection process to extract land cover features in the 2011 imagery.\",\n\t\"owner_org\":
